INSERT INTO `tbpublicerelationscontents` (`pubrelcont_id`, `pubrel_id`, `pubrelcontents`, `pubrelcont_createddate`, `pubrelcont_creator`) VALUES
('PR00002CON01', 'PR00002', 'ตัวอย่างที่ง่ายที่สุดจะเห็นได้จาก ทันทีที่อ้างว่าก็ไม่มีทุน ก็ไม่ทำ อ้างว่าจะทำได้อย่างไรในเมื่อ \"ไม่มี\" หากคิดช้า ๆ การไม่มีทุนคือสิ่งที่บอกว่า อันดับแรกคือ \"สะสม\" ทุน และการสะสมนั้นต้องอดทน และใช้ \"เวลา\" เมื่อไม่คิดจะพยายามอดทนสะสมจึงไม่มี \"ทุน\" ไปเรื่อย ๆ แล้วก็เอาเวลาไปทำอย่างอื่น ซึ่งส่วนใหญ่ก็มักอยู่กับความหวัง, รอคอย และไม่น้อยก็ทำลาย \"ทุน\" ที่ควรจะสะสมได้ เช่น ใช้จ่ายฟุ่มเฟื่อย หรือหาความสุขชั่วคราว ก็ไม่น่าแปลกใจที่สุดท้าย \"ไม่มีทุน\"', '2023-05-25', '1779800065026'),
('PR00002CON02', 'PR00002', 'ส่วนคนที่มีเงินมาก แต่ไม่ให้เวลาศึกษา, ใส่ใจ คิดหรือว่าการลงทุนนั้นจะได้กำไร? ย่อมโดนหลอกบ้าง เจ๊งบ้าง มีถมไป โชคดีก็มีทุนมาต่อยอดใหม่ แต่ถ้ายังไม่ให้ \"เวลา\" อีก เงินมากมายก็หายหมดได้ไม่ยากเลย', '2023-05-25', '1779800065026'),
('PR00002CON03', 'PR00002', 'ดูคำคมดีๆ ย้อนหลังทั้งหมดที่', '2023-05-25', '1779800065026'),
('PR00003CON01', 'PR00003', 'เนื้อหา 3/1', '2023-02-25', '1471200336695'),
('PR00003CON02', 'PR00003', 'เนื้อหา 3/2', '2023-02-25', '1471200336695'),
('PR00004CON01', 'PR00004', 'เนื้อหา 4/1', '2023-02-25', '1471200336695'),
('PR00004CON02', 'PR00004', 'เนื้อหา 4/2', '2023-02-25', '1471200336695'),
('PR00005CON01', 'PR00005', '“ไม่มีคำว่าสายเกินไป” เป็นประโยคในเชิงคิดบวก(อีกแล้ว) ซึ่งมันจริงหรือ? ก็ในเมื่อที่ผ่านมาเราก็ล้วนรู้แก่ใจว่า เคยเสียเวลา เคยเสียโอกาส และอยากย้อนไปแก้ไขอะไรตั้งมากมาย แต่ก็ทำไม่ได้เพราะ “มันสายไปแล้ว” นั่นเอง ดังนั้น ไม่มีคำว่าสายเกินไป มันก็แค่ประโยคปลอบใจตัวเองหรือเปล่า?', '2023-05-24', '1779800065026'),
('PR00005CON02', 'PR00005', 'เนื้อหา 5/2', '2023-05-24', '1779800065026'),
('PR00006CON01', 'PR00006', 'มีหลายเรื่องที่โลกดูไม่ยุติธรรม, มีหลายคนที่ยากจะเข้าใจความคิดของเขา, บ่อยครั้งที่อะไรไม่เป็นใจ และความพยายามของเรามีไม่น้อยกลับให้ผลตรงกันข้าม เมื่อเหตุการณ์เหล่านี้เกิดขึ้น การพร่ำบ่น ก่นด่า อาจเกิดขึ้นมา ทว่ามันก็ไม่ได้ดีขึ้น..', '2023-05-24', '1779800065026'),
('PR00006CON02', 'PR00006', 'การขว้างลูกบอลเข้ากำแพง ยิ่งขว้างแรงก็ยิ่งกระเด้งกลับมาแรง เสมือนการที่เราพ่นคำร้าย บ่นด่าออกไป ยิ่งสะท้อนภาวะจิตใจลึก ๆ ให้แย่ลง หลายครั้งเราพยายามที่จะใช้คำพูดประชด สาดใส่ หรือหวังพยายามกรีดแทงบางคน สิ่งที่ได้กลับมาอาจเป็นคำพูดที่แรง ๆ เช่นกัน แม้จะทำให้อีกฝ่ายเสียใจไปได้ แต่ผลลัพธ์ที่ดีก็ไม่เกิดขึ้น และการเสียความรู้สึกก็ก่อเกิดภายใต้จิตใจทั้งสองฝ่าย สุดท้ายผู้พูดอาจรู้สึกแย่กว่าเอง', '2023-05-24', '1779800065026'),
('PR00006CON03', 'PR00006', 'ในอีกทางหลายคนเข้าใจดีว่า เรื่องแย่ ๆ หลายเรื่องมันเกิดจากปัจจัยที่เราควบคุมไม่ได้ การจะพูดอะไรไปมันล้วนไร้ประโยชน์ นิ่ง เฉย อยู่แต่กับตัวเราไปเสียดีกว่า เช่นนี้ก็ดี...', '2023-05-24', '1779800065026'),
('PR00006CON04', 'PR00006', 'แต่ก็มีไม่น้อยที่กลายเป็นว่า ปัจจัยโดยอย่างยิ่งเมื่อเป็นคนอื่น พอเราไม่พูด กลับยิ่งมักง่าย, มองข้าม, หรือเข้าใจไปเองว่า ไม่จำเป็นต้องเกรงใจ บางทีก็นึกว่านั่น มันดีแล้ว เราชอบแล้ว...', '2023-05-24', '1779800065026'),
('PR00006CON05', 'PR00006', 'ดังนั้นการไม่บ่น ไม่ด่า ไม่พูด เป็นสิ่งที่ดีกว่าในหลายสถานการณ์ แต่การไม่พูดเลยบางทีก็สร้างความเข้าใจผิดได้', '2023-05-24', '1779800065026'),
('PR00007CON01', 'PR00007', 'โลกเราหมุนไปทุกวัน เราทราบดี แต่สิ่งที่เราไม่รู้หรืออาจเพียงลืมไป คือ เราต้องใช้ชีวิตไปตามโลก วันคืนที่สลับไปตามการหมุนของโลกนั้น มันหมายถึงสิ่งที่ต้อง เกิดขึ้น จางหาย ได้มา สูญเสีย ชดใช้ ไม่ต่างกับ แสงแดด ก้อนเมฆ สายลม และน้ำที่มีขึ้นลง ที่แปรผันตามการหมุนของโลกเช่นกัน', '2023-05-26', '1779800065026'),
('PR00007CON02', 'PR00007', 'แต่ละวันที่เราต้องกิน-ใช้ ต่อคำถามที่ว่าทำไมข้าวของแพงขึ้นทุกวัน อาจเป็นคำถามที่ไม่สบายใจนักสำหรับคนวัย 25+ เพราะสิ่งของที่เคยคุ้นเริ่มมีราคาที่แตกต่าง แต่หากวัย 40 ขึ้นไป แม้ไม่ได้รู้สึกดีแต่ก็คงเลิกสงสัยและยอมรับได้ว่ามันต้องเป็นเช่นนั้น \"ค่าครองชีพ\" เป็นเพียงสิ่งที่ได้มาและหายไปของหลายคน เพียงเพราะ \"ต้องกิน\" และ \"จำเป็นต้องใช้\" นี่คือสิ่งแรกที่ต้องเข้าใจว่าโลกหมุนไป เราหยุดไม่ได้หากชีวิตยังต้องดำเนิน', '2023-05-26', '1779800065026'),
('PR00007CON03', 'PR00007', 'หลายคนก้าวเดินไปข้างหน้า หางาน ทำเงิน เพื่อที่จะคว้าสิ่งที่ \"อยากได้\" มาให้ได้ โลกก็หมุนไปให้เราได้มาจนวันหนึ่ง แต่เราหลายคนก็ลืมว่า โลกมันไม่ได้หยุดเดินในวันที่เราได้มา หลังจากวันนั้นมันก็เสื่อมค่า เสื่อมถอย ผุพัง เสียหาย เสื่อมไปตามกาลเวลาอีกเช่นกัน เหมือนการมีรถสักคัน ได้มาแล้วใช้ไป หากมองอย่างเข้าใจ วันหนึ่งเราก็ต้อง หางาน ทำเงิน เพื่อจะได้มีรถคันใหม่มาแทนที่คันนี้', '2023-05-26', '1779800065026'),
('PR00007CON04', 'PR00007', 'หากลืมคิด หรือไม่เคยคิด มุ่งหน้าจนได้อะไรมาสิ่งหนึ่งแล้วก็มุ่งไปคว้าสิ่งอื่นต่อไป เมื่อโลกหมุนไปนานขึ้น สิ่งที่มีเริ่มจางหาย สิ่งใหม่ก็ยังไม่ได้มา เรี่ยวแรงจะมุ่งหา 2-3 สิ่งให้ได้พร้อมกันนั้น มันไม่ง่ายเลย และเป็นเรื่องธรรมดาที่ยิ่งมีรายได้ ยิ่งได้มาก ยิ่งต้องจ่ายมากขึ้นตามกันหากไม่ได้เฉลียวใจ \"ก็หมุนไม่ทัน\"', '2023-05-26', '1779800065026'),
('PR00007CON05', 'PR00007', 'บางสิ่ง \"ที่ไม่ใช่สิ่งของ\" ก็เช่นกัน ไม่ว่าจะเป็นความรู้สึก หรือความสัมพันธ์ การที่โลกหมุนไปย่อมทำให้หลายปัจจัยเปลี่ยนแปลง ความจำเป็น ระยะทาง ปัจเจก ความจำเพาะบุคคล มิอาจหยุดนิ่งให้ไม่มีสิ่งใดส่งผลต่อเราหรือใคร ดังเช่น ตุ๊กตาตัวเก่า เสื้อตัวเก่ง แม้จะโทรมแค่ไหนเรายังรู้สึกดีกับสิ่งนั้นได้ก็จริงอยู่ แต่วันหนึ่งมันก็จะมีภาวะที่เป็นไป เช่น ของเล่นชิ้นที่เคยโปรดแค่ไหน โตมาก็ใช่ว่าจะรู้สึกดีหากไปนั่งเล่นกับมัน ผ้าห่มผืนน้อย เสื้อตัวโปรด ที่เราไม่เคยรังเกียจแม้จะเก่าแค่ไหน แต่ก็คงรู้สึกไปได้ไม่ตลอด ไม่ต่างกับความสัมพันธ์ต่อสิ่งมีชีวิตที่ย่อมมีปัจจัยทำให้แยกออกจากกัน เป็นเรื่องยากที่จะใช้ชีวิตกับเพียงบางสิ่งตลอดไปเสมือนไม่มีสิ่งใดสำคัญอีกแล้วบนโลกนี้ เพื่อนรัก คนสนิท ครอบครัว ล้วนผูกติดไว้ไม่ได้ตลอดไป แล้วบางทีในมุมเขาเหล่านั้นก็อาจเป็นฝ่ายไม่ต้องการเราก่อนอีกด้วย', '2023-05-26', '1779800065026'),
('PR00007CON06', 'PR00007', 'แม้เราจะรู้หรือเข้าใจกันดีอยู่ว่าโลกจริงต้องหมุนไป คล้ายชีวิตต้องดำเนินต่อไป แต่โลกก็ยังมีอีกสิ่งที่เรียกว่า แรงโน้มถ่วง ที่ทำให้ทุกอย่างมีน้ำหนักและติดอยู่กับโลกนี้ เปรียบได้ว่าในทุกการเคลื่อนไหวเราต้องออกแรงเพื่อที่จะ ลุก เดิน หรือก้าวไป ไม่เพียงเท่านั้นมันยังทำให้เรา \"เจ็บ\" อีกด้วยถ้าล้มลง การมีบางสิ่งมาถ่วงให้เราหนัก ก็เหมือนดังอุปสรรคฉุดไว้ให้เดินลำบาก...', '2023-05-26', '1779800065026'),
('PR00007CON07', 'PR00007', 'หากลำพังตัวเราก็อาจเพียงแค่หมุนตามโลก แต่เราล้วนมีความรู้สึก มีความขี้เกียจ มีปมในใจ มีคนรอบข้าง มีสังคม สิ่งแวดล้อม กระทั่งความผิดพลาดในอดีตของเราเอง เหล่านี้คือสิ่งที่ \'ถ่วง\' ให้ไม่ได้เดินหน้าไปได้ง่าย ๆ ใครปลดเปลื้องได้ ปล่อยวางได้ จัดการได้ดีกว่า ย่อมเบาตัวกว่าไปได้ง่ายไปได้เร็วกว่า...', '2023-05-26', '1779800065026'),
('PR00007CON08', 'PR00007', 'คนอยู่เฉย ๆ ย่อมไม่เหนื่อย คนเดินเหนื่อยน้อยกว่าคนวิ่ง คนวิ่งอาจเหนื่อยน้อยกว่าคนที่ต้องแบก เราล้วนต้านแรงโน้มถ่วงที่ไม่เท่ากัน หากเลือกจะอยู่เฉยโลกก็จะเคลื่อนที่หนีไปอยู่ดี...', '2023-05-26', '1779800065026'),
