('PR00009CON02', 'PR00009', 'เนื้อหา 9/2', '2023-02-25', '1471200336695'),
('PR00009CON03', 'PR00009', 'เนื้อหา 9/3', '2023-02-25', '1471200336695'),
('PR00010CON01', 'PR00010', 'เนื้อหา 10/1', '2023-02-25', '1471200336695'),
('PR00010CON02', 'PR00010', 'เนื้อหา 10/2', '2023-02-25', '1471200336695'),
('PR00011CON01', 'PR00011', '\"ก็เขาเก่งนี่\" ประโยคที่นัยหนึ่งก็ชื่นชม นัยหนึ่งก็ประชดประชัน ซึ่งบางทีไม่ใช่ประชดใครแต่ประชดจิตใจตัวเอง จริงอยู่ที่มีหลายเรื่องที่เราเก่งสู้เขาไม่ได้ แต่เราล้วนเก่งขึ้นได้ ทว่าหากต้องแข่งขันบางทีโชคดีที่เราไม่เก่งมาก่อน', '2023-05-24', '1779800065026'),
('PR00011CON02', 'PR00011', 'ความเก่ง เกิดขึ้นได้จากหลายแบบไม่ว่าจะ ความหมั่นเพียร(ฝึกซ้อม), ประสบการณ์, สิ่งแวดล้อมเกื้อหนุน, มีต้นทุนบางอย่างดี เหมือนคนเกิดมาร่างกายสูงใหญ่มีโอกาสเก่งในกีฬาหลายประเภท นี่ก็ถือว่าต้นทุนดี แต่เหล่านี้เองจึงย้อนไปบั่นทอนคนที่คิดว่าตนไม่เก่ง เช่น เราขี้เกียจ-ไม่มีเวลาซ้อม, เราไม่เคยทำมาก่อน, ยังไม่พร้อม, ต้นทุนไม่ดีเหมือนเขา ส่วนหนึ่งก็ใช่ว่าผิด แต่มันก็ใช่ว่าถูกและบางทีถ่วงเป็นอย่างมาก', '2023-05-24', '1779800065026'),
('PR00012CON01', 'PR00012', 'บ่อยครั้งแล้วกับเรื่องเป้าหมาย ที่บทความหรืออะไรก็ตามด้านพัฒนาตนเองมีมาเสมอ เช่นเป้าหมายที่ดีต้อง SMART* หลายคนก็อาจเริ่มเบื่อ หลายคนเริ่มสงสัยว่าสำคัญขนาดนั้นหรือ หลายคนเริ่มเข้าใจ แต่สุดท้ายมันก็มักคล้ายก่อกองทราย ไม่นานก็พังทลายลง เพราะที่จริงถ้ามีเป้าหมายระยะสั้นอาจจำเป็นกว่า', '2023-05-25', '1779800065026'),
('PR00012CON02', 'PR00012', 'ขอยกตัวอย่างเพื่อความกระชับ อยากมีเงินเก็บ 1 ล้านไหม? สำหรับคนที่ยังติดลบ, เดือนชนเดือน หรือแต่ละเดือนเหลือไม่กี่ร้อย คงตอบว่า \"อยาก.. แบบถอนหายใจ\" เพราะมันสะท้อนถึงความรู้สึกไกลเกินจริง นี่คืออุปสรรคแรกที่ทำให้เราไม่สนเป้าหมาย เพราะทันทีที่เรามองปัจจุบัน ก็ประเมินได้ว่า \"อย่าดีกว่า\" กับเป้าหมายนั้น ซึ่งก็ใช่ อะไรที่เกินตัวมันดูเพ้อฝัน', '2023-05-25', '1779800065026'),
('PR00012CON03', 'PR00012', 'ครั้นพอบอกว่า อยากมีเงินเก็บ 5 พันไหม เราคนเดิมก็ส่ายหัว เพราะรู้สึกเสียเวลา แค่นี้แป๊บเดียวก็หาได้ ซึ่งก็ใช่... แต่เอ๊ะมันย้อนแย้งไหม ในเมื่อเดิมแต่ละเดือนเหลือไม่เท่าไรแล้วทำไม 5 พันคิดว่าทำได้ คำตอบในหัวอาจมีหลากหลาย แต่อย่างหนึ่งที่คงแอบคิดในใจคือ \"ก็มันไม่มากเท่าไร..\"', '2023-05-25', '1779800065026'),
('PR00012CON04', 'PR00012', 'คำถามที่อยากชวนคิดต่อ แล้วก่อนจะไป 1 ล้านเราต้องผ่าน 5 พันก่อนไหม?.. ใช่มันต้องผ่าน', '2023-05-25', '1779800065026'),
('PR00012CON05', 'PR00012', 'แล้วจำนวน 200 ล่ะมากไหม?.. เทียบกับ 1 ล้าน หรือ 5 พัน มันก็ไม่มากอะไร', '2023-05-25', '1779800065026'),
('PR00012CON06', 'PR00012', 'งั้นคิดดูนะ 5 พัน 200 ครั้ง มันก็ได้ 1 ล้านแล้ว... ถึงตรงนี้ หลายคนอาจใจพองขึ้นมา หลายคนฉุกคิด หลายคนพยักหน้า สรุปเลยแล้วกันว่า อย่าเพิ่งไปคิด 1 ล้าน คิด 5,000 ไปสักพักให้ได้ก็ใกล้สำเร็จแล้ว', '2023-05-25', '1779800065026'),
('PR00013CON01', 'PR00013', 'จำได้ไหมว่าปั่นจักรยานครั้งแรกรู้สึกอย่างไร? ทำกับข้าวครั้งแรกออกมาเป็นแบบไหน? กว่าจะใช่โปรแกรมหนึ่งได้คล่องนานเท่าไร? กว่าจะกล้าพูดต่อหน้าคนมากมาย และอีกหลายอย่างที่ล้วนเป็นทักษะ แล้ว\r\nความรักล่ะ คิดว่าเป็นทักษะไหม?', '2023-07-07', '1779800065026');
